import React from "react";
import logo from "./logo.png";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <>
      <div
        className="min-h-screen"
        style={{
          backgroundImage: "linear-gradient(120deg, #fdfbfb 0%, #ebedee 100%)",
        }}
      >
        {/* Navigation Bar */}
        <motion.div
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="fixed w-full bg-white shadow-md p-4 flex justify-between items-center"
        >
          <div className="flex items-center">
            <img
              src={logo} // Replace with your logo URL
              alt="Logo"
              className="h-10 w-20 mr-3"
            />
            <span className="text-2xl font-bold text-purple-600">Dashboard</span>
          </div>
          <div className="flex items-center">
            <span className="text-lg font-semibold text-gray-700 mr-4">
              Username
            </span>{" "}
            {/* Replace 'Username' with actual username */}
            <button
              className="text-white bg-purple-600 hover:bg-purple-700 focus:ring-4 focus:outline-none focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-purple-600 dark:hover:bg-purple-700 dark:focus:ring-purple-800"
              onClick={() => navigate("/")}
            >
              Log out
            </button>
          </div>
        </motion.div>

        {/* Main Content */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="pt-20 flex flex-col items-center justify-center pb-5"
        >
          <motion.div
            initial={{ opacity: 0, scale: 0 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            className="flex justify-center items-center pb-5 pt-5"
          >
            <h1 className="text-4xl font-bold text-purple-600">Forms Page</h1>
          </motion.div>
          <motion.div
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5, delay: 0.4 }}
            className="pb-2 flex justify-end w-full pr-14"
          >
            <button
              className="text-white bg-purple-500 hover:bg-purple-700 focus:ring-4 focus:outline-none focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-purple-600 dark:hover:bg-purple-700 dark:focus:ring-purple-800"
              onClick={() => navigate("/Editor")}
            >
              Create
            </button>
          </motion.div>

          <motion.div
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.6 }}
            className="grid justify-center items-center grid-cols-3 gap-6"
          >
            {/* Your form cards here */}
            <motion.div
              initial={{ opacity: 0, scale: 0 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5, delay: 0.8 }}
              className="bg-purple-500 border-2px border-black rounded-sm relative shadow-lg"
              style={{
                width: "400px",
                height: "200px",
                padding: "24px",
              }}
            >
              <p className="text-5xl text-white">Form 1</p>
            </motion.div>
            <motion.div
              initial={{ opacity: 0, scale: 0 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5, delay: 1 }}
              className="bg-purple-500 border-2px border-black rounded-sm relative shadow-lg"
              style={{
                width: "400px",
                height: "200px",
                padding: "24px",
              }}
            >
              <p className="text-5xl text-white">Form 2</p>
            </motion.div>
            <motion.div
              initial={{ opacity: 0, scale: 0 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5, delay: 1.2 }}
              className="bg-purple-500 border-2px border-black rounded-sm relative shadow-lg"
              style={{
                width: "400px",
                height: "200px",
                padding: "24px",
              }}
            >
              <p className="text-5xl text-white">Form 3</p>
            </motion.div>
          </motion.div>
        </motion.div>
      </div>
    </>
  );
};

export default Dashboard;
